-- Lookup table for trig functions as sqlite lacks sin/cos/tan/cot. This data is here in case any reports need to do things like
-- calculate sunrise/sunset times.
CREATE TABLE trig_lookup (
  angle real primary key,
  sin float,
  cos float,
  tan float,
  cot float
);

CREATE TABLE inverse_trig_lookup (
  angle real primary key,
  acos real,
  asin real
);
